"    body {
        box-sizing: border-box;
        font-size: 16px;
        font-weight: 400;
        letter-spacing: -0.14px;
        line-height: 28px;
        max-width: 100%;
        overflow-wrap: break-word;
        word-break: break-word;
    }
    * {
        box-sizing: inherit;
    }
    html, div, p, span {
        font-size: inherit;
        font-weight: inherit;
        line-height: inherit;
    }
    p {
        margin: 0;
    }
    h1 {
        font-size: 36px;
        line-height: 40px;
        margin: 0;
        font-weight: 800;
    }
    h2 {
        font-size: 24px;
        line-height: 32px;
        margin: 0;
        font-weight: 700;
    }
    h3 {
        font-size: 20px;
        line-height: 32px;
        margin: 0;
        font-weight: 600;
    }

